function Jhelpers(){this.guessFileTypeFromFileTag=function(c){return"undefined"==typeof c?null:c&&c.files&&c.files[0]&&c.files[0].type?c.files[0].type:null},this.compareDates={convert:function(c){return c.constructor===Date?c:c.constructor===Array?new Date(c[0],c[1],c[2]):c.constructor===Number?new Date(c):c.constructor===String?new Date(c):"object"==typeof c?new Date(c.year,c.month,c.date):NaN},compare:function(c,e){return isFinite(c=this.convert(c).valueOf())&&isFinite(e=this.convert(e).valueOf())?(c>e)-(c<e):NaN},inRange:function(c,e,f){return isFinite(c=this.convert(c).valueOf())&&isFinite(e=this.convert(e).valueOf())&&isFinite(f=this.convert(f).valueOf())?e<=c&&c<=f:NaN}},this.getRandomNumber=function(c,e){return Math.random()*(e-c)+c},this.getRoundRandomNumber=function(c,e){return+Math.floor(this.getRandomNumber(c,e))},String.prototype.ltrim=function(c){return this.replace(new RegExp("^["+(c||"\\s")+"]+","g"),"")},String.prototype.rtrim=function(c){return this.replace(new RegExp("["+(c||"\\s")+"]+$","g"),"")},String.prototype.trim=function(c){return this.ltrim(c).rtrim(c)}}var jHelpers=new Jhelpers;